import React from 'react';
import ReactDOM from 'react-dom';
import './Levels.css';
import Question from './Question';

function Levels() {
    var newButtons = [];
    for (var i=1; i<101; i++) {
        newButtons.push(<button key={i} type="button" id={i}>{i}</button>);
    }
    for (var j=0; j<newButtons.length; j++) {
        document.querySelectorAll("button").onclick = function () {
            ReactDOM.render(<Question />, document.getElementById("root"));
        }
    }
    return (
        <div className="container">
            <div className="levels">
                <h1>Levels</h1>   
                {newButtons}
            </div>
        </div>
    );
}

export default Levels;
